import React from "react";
import { Link } from "react-router-dom";

function Orders() {
    const orders = [
        {
            orderId: 1,
            productLink: "/product/1",
            customerName: "John Doe",
            customerNumber: "1234567890",
            customerLocation: "New York",
            price: "$99.99",
        },
        {
            orderId: 2,
            productLink: "/product/2",
            customerName: "Jane Smith",
            customerNumber: "9876543210",
            customerLocation: "Los Angeles",
            price: "$79.99",
        },
    ];

    return (
        <div className="container mx-auto py-8">
            <h2 className="text-2xl font-bold mb-4">Orders</h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                {orders.map(({
    orderId,
    productLink,
    customerName,
    customerNumber,
    customerLocation,
    price,
}) => (
                    <div
                        className="bg-white shadow rounded p-4"
                        key={order.orderId}
                    >
                        <h3 className="text-lg font-bold mb-2">
                            Order ID: {orderId}
                        </h3>
                        <p>
                            Product:{" "}
                            <Link to={productLink} className="text-blue-500">
                                View Product
                            </Link>
                        </p>
                        <p className="text-gray-600">
                            Customer Name: {customerName}
                        </p>
                        <p className="text-gray-600">
                            Customer Number: {customerNumber}
                        </p>
                        <p className="text-gray-600">
                            Customer Location: {customerLocation}
                        </p>
                        <p className="text-gray-600">Price: {price}</p>
                    </div>
                ))}
            </div>
        </div>
    );
}

function OrderCard({
    orderId,
    productLink,
    customerName,
    customerNumber,
    customerLocation,
    price,
}) {
    return (
        <div className="bg-white shadow rounded p-4">
            <h3 className="text-lg font-bold mb-2">Order ID: {orderId}</h3>
            <p>
                Product:{" "}
                <Link to={productLink} className="text-blue-500">
                    View Product
                </Link>
            </p>
            <p className="text-gray-600">Customer Name: {customerName}</p>
            <p className="text-gray-600">Customer Number: {customerNumber}</p>
            <p className="text-gray-600">
                Customer Location: {customerLocation}
            </p>
            <p className="text-gray-600">Price: {price}</p>
        </div>
    );
}

export default Orders;
